import React from 'react';
import {Col, Container, Row} from "react-bootstrap";
import TypeBar from "../components/TypeBar";
import DeveloperBar from "../components/DeveloperBar";

const Shop = () => {
    return (
        <Container>
            <Row className="mt-2">
                <Col md={3}>
                    <TypeBar></TypeBar>
                </Col>
                <Col md={9}>
                   <DeveloperBar></DeveloperBar>
                </Col>
            </Row>
        </Container>
    );
};

export default Shop;
